import s from './Header.module.css';
import {Link} from 'react-router-dom';

const Header = (props) => {
    return (
        <div className={s.header}>
            { props.isInitialized
                ?  <button>К проектам</button>
                : <div>
            не
                </div> }
            <div className={s.title}>ToDo List</div>
        </div>
    );
};

export default Header;
